import React, { useEffect, useState } from "react";
import PanelTemplate from "./PanelTemplate";
import jsPDF from "jspdf";
import autoTable from "jspdf-autotable";// Tabloyu PDF'e düzgün yerleştirmek için gerekli

function Reports() {
    const [persons, setPersons] = useState([]);
    const [selectedPerson, setSelectedPerson] = useState(null);
    const [personDetails, setPersonDetails] = useState([]);

    useEffect(() => {
        fetch("http://localhost:5003/manager/generalReport")
            .then(res => res.json())
            .then(data => {
                if (data.success) {
                    setPersons(data.report);
                }
            })
            .catch(err => console.error("Fetch error:", err));
    }, []);

    // ==========================================
    //   PDF OLUŞTURMA VE İNDİRME FONKSİYONU
    // ==========================================
    const downloadPDF = () => {
        try {
            const doc = new jsPDF({
                orientation: "landscape",
                unit: "mm",
                format: "a4"
            });

            // Başlık Ayarları
            doc.setFontSize(18);
            doc.setTextColor(40);
            doc.text("Genel Personel ve Musteri Raporu", 14, 15);

            doc.setFontSize(10);
            doc.text(`Tarih: ${new Date().toLocaleString()}`, 14, 22);

            // Tablo Sütunlarını Tanımla
            const tableColumn = ["ID", "First Name", "Last Name", "Gender", "Email", "City", "Role"];

            // Tablo Verilerini Hazırla
            const tableRows = persons.map(p => [
                p.person_id,
                p.first_name,
                p.last_name,
                p.gender,
                p.email,
                p.address,
                p.city,
                p.postalcode,
                p.phone_number,
                p.age,
                p.role,
                p.username
            ]);

            // autoTable Çağrısı (En güvenli yazım şekli)
            autoTable(doc, {
                head: [tableColumn],
                body: tableRows,
                startY: 30,
                theme: 'grid',
                headStyles: { fillColor: [83, 132, 86] }, // Senin buton yeşilin
                styles: { fontSize: 9 }
            });

            // Dosyayı Kaydet
            doc.save("Person_General_Report.pdf");

        } catch (error) {
            console.error("Detaylı PDF Hatası:", error);
            alert("PDF oluşturulamadı. Lütfen kütüphanelerin yüklü olduğunu kontrol edin.");
        }
    };
    return (
        <PanelTemplate
            title="Reports"
            rightContent={
                <div style={{ width: "100%" }}>
                    <div style={{ marginBottom: "20px", display: "flex", justifyContent: "space-between", alignItems: "center" }}>
                        <h2 style={{ color: "#2f4036" }}>General Person List</h2>

                        {/* PDF BUTONU AKTİFLEŞTİRİLDİ */}
                        <button
                            type="button"
                            onClick={downloadPDF}
                            style={{
                                backgroundColor: "#538456ff",
                                color: "white",
                                padding: "10px 25px",
                                borderRadius: "8px",
                                border: "none",
                                cursor: "pointer",
                                fontWeight: "bold",
                                boxShadow: "0 2px 4px rgba(0,0,0,0.2)"
                            }}
                        >
                            Download PDF Report
                        </button>
                    </div>

                    <table className="orders-table" border="1">
                        <thead>
                            <tr>
                                <th>ID</th>
                                <th>First Name</th>
                                <th>Last Name</th>
                                <th>Gender</th>
                                <th>Email</th>
                                <th>address</th>
                                <th>City</th>
                                <th>postal_code</th>
                                <th>Phone</th>
                                <th>Age</th>
                                <th>Role</th>
                                <th>Username</th>
                            </tr>
                        </thead>
                        <tbody>
                            {persons.map(p => (
                                <tr key={p.person_id} style={{ cursor: "pointer" }}>
                                    <td>{p.person_id}</td>
                                    <td>{p.first_name}</td>
                                    <td>{p.last_name}</td>
                                    <td>{p.gender}</td>
                                    <td>{p.email}</td>
                                    <td>{p.address}</td>
                                    <td>{p.city}</td>
                                    <td>{p.postalcode}</td>
                                    <td>{p.phone_number}</td>
                                    <td>{p.age}</td>
                                    <td>{p.role}</td>
                                    <td>{p.username}</td>
                                    <td style={{ fontWeight: "bold" }}>{p.role}</td>
                                </tr>
                            ))}
                        </tbody>
                    </table>
                </div>
            }
        />
    );
}

export default Reports;
